import React from 'react';

const Login = () => {
    return (
        <div className="loginBanner container-fluid">
            <div className="row justify-content-center align-items-center h-100">
                <div className="loginDiv bg-warning col-10 col-sm-6 col-md-3 mx-auto d-flex flex-column justify-content-center align-items-center p-3">
                    <img className="logo rounded-circle" src={require('../images/globe.png')} alt="logo" />
                    <input className="w-100" type="text" placeholder="Your Name" />
                </div>
            </div>
        </div>
    )
}

export default Login;
